description:
The Babysitter 3 (Nica Noelle, Sweet Sinner / 2013)

It's Not The Baby She Wants To Take Care Of! When new parents Zoe Voss and Manuel Ferrara decide they need some extra help with the baby, Zoe places an ad for a part time babysitter. Sexy young Chastity Lynn arrives for an interview, and impresses willowy brunette Zoe that she's perfect for the job. But when Zoe introduces Chastity to Manuel, there's an instant attraction between the suave French daddy and the athletic blonde teen. Will Zoe's female intuition kick in before the hot young babysitter steals her husband?.

Chastity Lynn, Samantha Ryan, Zoe Voss, Manuel Ferrara, Mark Wood, Rocco Reed

Feature, Couples

